using NUnit.Framework;
using System;
using System.Collections.Generic;
using System.Text;

namespace ExampleDotnetCore.LeetCode
{
    class LongestSubstringSolution
    {
        /*
         * https://leetcode.com/problems/longest-substring-without-repeating-characters/
         */

        /**
         * Solution with sliding window
         */
        public int LengthOfLongestSubstring(string str)
        {
            int maxSubstringLength = 0, strLength = str.Length, startWindowPos = 0, endWindowPos = 0;

            if (string.IsNullOrEmpty(str)) return maxSubstringLength;
            if (strLength == 1) return 1;

            var frequencies = new HashSet<char>(); // use hash table as a sliding window

            while (startWindowPos < strLength && endWindowPos < strLength)
            {
                if (frequencies.Contains(str[endWindowPos]))
                {
                    frequencies.Remove(str[startWindowPos++]); // remove symbols from the start of sliding window
                }
                else // unique symbols ... try to sample more unique symbols
                {
                    frequencies.Add(str[endWindowPos++]); // add symbols to end of window
                    maxSubstringLength = Math.Max(maxSubstringLength, endWindowPos - startWindowPos);
                }
            }
            return maxSubstringLength;
        }

        [Test]
        public void Test()
        {
            Assert.AreEqual(3, LengthOfLongestSubstring("abcabcbb"));
        }

        [Test]
        public void Test2()
        {
            Assert.AreEqual(1, LengthOfLongestSubstring("bbbbb"));
        }

        [Test]
        public void Test3()
        {
            Assert.AreEqual(3, LengthOfLongestSubstring("pwwkew"));
        }

        [Test]
        public void Test4()
        {
            Assert.AreEqual(3, LengthOfLongestSubstring("dvdf"));
        }

        [Test]
        public void Test5()
        {
            Assert.AreEqual(1, LengthOfLongestSubstring(" "));
        }

        [Test]
        public void Test6()
        {
            Assert.AreEqual(4, LengthOfLongestSubstring("jbpnbwwd"));
        }

